import {Dialog,Box,styled} from '@mui/material';
import Menu from './menu/Menu';
import EmptyChat from './chat/EmptyChat';

const dialogStyle={
    height:'96%',
    width:'100%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'hidden',
    margin:'20px'
}

const component=styled(Box)`
 display:flex;
`
const left=styled(Box)`
 min-width:450px;
`
const right=styled(Box)`
 width:73%;
 min-width:300px;
 height:100%;
 border-left:1px solid rgba
`

const ChatDialog = () => {

   return (

    <Dialog
       open={true}
       PaperProps={{sx:dialogStyle}}
       hideBackdrop={true}
    >

     <component>
        <left>
            <Menu/>
        </left>

        <Box>

            <EmptyChat/>

        </Box>
        
     </component>   


    </Dialog>
    
   )
}

export default ChatDialog;
